import React from 'react';
import './Perfil.css';
import {Link} from 'react-router-dom';
import lilo from '../assets/lilo.svg';


export default function Perfil() {
    return(
         <div className="perfil-container">
             <title>
                 Meu Perfil
             </title>
             <footer>
                <img id="foto" src={lilo} alt="Danimali" />
             </footer>
         </div>
    )
    }
